webpackJsonp([0x843e750b0393],{601:function(t,e){t.exports={data:{wordpressPost:{title:"Drugs and mental health, the mistreatment of clinical interns and evidence-based practice: Most-read articles in February",content:'<p>&nbsp;</p>\n<p>The most-read article in February was Al-Shafaee and colleagues&#8217; study of the mistreatment of clinical interns in Oman. Doyle <em>et al</em>&#8216;s  systematic review of the links between patient experience and clinical safety &#8211; originally published in January &#8211; remains popular,  and Ubbink <em>et al&#8217;s </em>newly published scoping review on evidence-based practice was the third most-read.</p>\n<p>Ward <em>et al</em>&#8216;s paper on new drug launches in the UK received plenty of media attention, including articles by <a href="http://www.bbc.co.uk/news/health-21519901">the BBC</a>.</p>\n<table width="483" border="1" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td valign="top" width="50">Rank</td>\n<td valign="top" width="132">Author(s)</td>\n<td valign="top" width="301">Title</td>\n</tr>\n<tr>\n<td width="50">1</td>\n<td width="132">Al-Shafaee <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/2/e002076.full">Pilot study on the prevalence of abuse and mistreatment during clinical internship: a cross-sectional study among first year residents in Oman</a></td>\n</tr>\n<tr>\n<td width="50">2</td>\n<td width="132">Doyle <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/1/e001570.full">A systematic review of evidence on the links between patient experience and clinical safety and effectiveness</a></td>\n</tr>\n<tr>\n<td width="50">3</td>\n<td width="132">Ubbink <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/1/e001881.full">Framework of policy recommendations for implementation of evidence-based practice: a systematic scoping review</a></td>\n</tr>\n<tr>\n<td width="50">4</td>\n<td width="132">Hermens <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/2/e002229.full">Frequent alcohol, nicotine or cannabis use is common in young persons presenting for mental healthcare: a cross-sectional study</a></td>\n</tr>\n<tr>\n<td width="50">5</td>\n<td width="132">Ward <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/2/e002088.full">Decline in new drug launches: myth or reality? Retrospective observational study using 30 years of data from the UK</a></td>\n</tr>\n<tr>\n<td width="50">6</td>\n<td width="132">Erviti <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/2/e002084.full">Oral bisphosphonates may not decrease hip fracture risk in elderly Spanish women: a nested case–control study</a></td>\n</tr>\n<tr>\n<td width="50">7</td>\n<td width="132">Clar <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/2/5/e001007.full">Systematic review of SGLT2 receptor inhibitors in dual or triple therapy in type 2 diabetes</a></td>\n</tr>\n<tr>\n<td width="50">8</td>\n<td width="132">Treweek <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/2/e002360.full">Methods to improve recruitment to randomised controlled trials: Cochrane systematic review and meta-analysis</a></td>\n</tr>\n<tr>\n<td width="50">9</td>\n<td width="132">Bellis <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/2/6/e002089.full">Dying to be famous: retrospective cohort study of rock and pop star mortality and its association with adverse childhood experiences</a></td>\n</tr>\n<tr>\n<td width="50">10</td>\n<td width="132">Katzmarzyk <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/2/4/e000828.full">Sedentary behaviour and life expectancy in the USA: a cause-deleted life table analysis</a></td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>Most read figures are based on pdf downloads and full text views. Abstract views are excluded.<!--TrendMD v2.4.3--></p>\n'},site:{siteMetadata:{title:"Gatsby Default Starter"}}},pathContext:{id:"d72d860c-b950-58e9-973b-50751f398cc9"}}}});
